import React from 'react';

const Sports = () => {
    return (
        <div>
            <div>
                <h4 className="text-info">Try Now</h4>
                <h1>Winter Sports</h1>
            </div>
            <div>
                <iframe width="660" height="415" className="p-5" src="https://www.youtube.com/embed/xd39Ho1kfqc" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
        </div>
    );
};

export default Sports;
